import React from "react";
import { Typography, Box } from "@mui/material";

function Home() {
  return (
    <Box
      sx={{
        height: "100vh", // Set height to 100vh
        display: "flex-top",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <Typography
        variant="h1"
        sx={{
          fontFamily: "Rubik",
          fontSize: "6rem",
          color: "lightblack",
          marginBottom: "20px",
        }}
      >
        Welcome To SuperSonics
      </Typography>
      {/* Add other content here */}
    </Box>
  );
}

export default Home;
